	private static void basement(World world, int i, int j, int k, Random rand) {
		boolean noair = false;
		int y = -1;
		do {
			noair = false;
			for(int x = 1; x <= 12; x++) {
				for(int z = 0; z <= 12; z++) {
					//5,y,4
					int d = (x-6)*(x-6)+(z-7)*(z-7);
					if(d <= 26) {
						if(!world.getBlock(i+x, j+y, z+k).isOpaqueCube() || world.getBlock(i+x, j+y, z+k) == Blocks.leaves) {
							noair=true;
							world.setBlock(i+x, j+y, z+k, StructureGenHelper.blockChance90p(rand, Blocks.stonebrick), StructureGenHelper.stoneBrickMetaAncient(rand), 2);
						}
					}
				}
			}
			y--;
		} while(noair && (j+y) >= 0);
	}
